                </div>
                <span slot="footer" class="dialog-footer">
            <el-button @click="switchDialog = false">取 消</el-button>
            <el-button type="primary" @click="changeRoleHandle">确 定</el-button>
            </span>
            </el-dialog>
            <!--切换身份对话框-->
        </div>
    </header>
</template>
<script>
    import Attachment from './Attachment';
    import {CommonUtils} from "../utils/commonUtil";
    import {changeRole} from "../api/user";

    export default {
        name: "Navigation",
        props: {
            page: {type: String, required: true}
        },
        components: {
            Attachment
        },
        data() {
            return {
                logoUrl: "",
                user: null,
                searchContent: "",
                dialogVisible: false,
                switchDialog: false,
                radio: '1',
                idtype: true
            };
        },
        methods: {
            logout() {
                localStorage.clear();
                sessionStorage.clear();
                this.$store.commit('exit');
                this.loginState = false;
                this.$router.go(0);
            },
            goto(path) {            //切换页面
                this.$router.push({name: path});
            },
            search() {
                let url = "";
                if (this.$route.name === "job_all" || this.$route.name === "jobSearch") {
                    url = `/job/all/${this.searchContent}`;
                    this.$router.push(url, () => {
                    }, err => err);
                } else if (this.$route.name === "company_all" || this.$route.name === "companySearch") {
                    url = `/company/all/${this.searchContent}`;
                    this.$router.push(url, () => {
                    }, err => err);
                } else if (this.$route.name === "talent_all" || this.$route.name === "talent_search") {
                    url = `/talent/all/${this.searchContent}`;
                    this.$router.push(url, () => {
                    }, err => err);
                }
            },
            CloseDialog() {                  //关闭上传简历对话框
                this.dialogVisible = false;
            },
            init() {
                this.user = localStorage.getItem("user");
                if (this.user) {
                    this.logoUrl = CommonUtils.staticPathPrefix + CommonUtils.getStore("user").headerImagePath;
                    switch (this.$store.state.identityType) {//1为招聘者,2是应聘者
                        case 1: {                             //招聘者
                            this.idtype = false;
                            this.radio = "1";
                            break;
                        }
                        case 2: {                            //应聘者
                            this.idtype = true;
                            this.radio = "2";
                            break;
                        }
                    }
                } else {
                    this.logoUrl = "../assets/img/msg_avatar.png";
                }

            },
            changeRoleHandle(){         //切换角色
                let localuser = CommonUtils.getStore("user");
                if(localuser.identityType === 2 && this.radio === "2"){
                    this.$message.error("当前身份为应聘者，无法切换");
                } else if(localuser.identityType === 1 && this.radio === "1"){
                    this.$message.error("当前身份为招聘者，无法切换");
                }else {
                    changeRole(this.radio,CommonUtils.getStore("token"))
                        .then(res=>{
                            console.log(res);
                            if(res.code === 0){
                                this.$message.success("切换成功");
                                localStorage.clear();
                                sessionStorage.clear();
                                this.$store.commit('exit');
                                this.loginState = false;
                                this.switchDialog = false;
                                setTimeout(()=>{
                                    this.$router.push("/login");
                                },900);
                            }else{
                                this.$message.error(res.message);
                            }
                        })
                        .catch(err=>{
                            console.log(err);
                        })
                }
            }
        },
        created() {
            this.init();
        },
        mounted() {

        }
    }
</script>
<style scoped>
    @import "../assets/css/components/header.css";
</style>